import logo from './logo.svg';
import './App.css';
import Quotes from './Quotes'

function App() {

  const level1 = ["Educational", "Inspirational", "Love"];

  return (
    <div className="App">
      <div>something</div>
      <div className='container'>
        {level1.map((category, index) => (
          <button key={index} className="button">
            {category}
          </button>
        ))}
      </div>
    </div>
  );
}

export default App;
